type RailsResponse map[string]Rail

type Rail struct {
	ChainID       int             `json:"chain_id"`
	Color         string          `json:"color"`
	Name          string          `json:"name"`
	IsLivenet     bool            `json:"is_livenet"`
	NativeAsset   string          `json:"native_asset"`
	Faucet        string          `json:"faucet"`
	XpopEndpoints []XpopEndpoints `json:"xpop_endpoints,omitempty"`
	Endpoints     []RailsEndpoint `json:"endpoints"`
	Explorers     []RailsExplorer `json:"explorers"`
	RPC           string          `json:"rpc,omitempty"`
	Definitions   string          `json:"definitions,omitempty"`
	Icons         RailsIcon       `json:"icons"`
}

type RailsEndpoint struct {
	Name string `json:"name"`
	Url  string `json:"url"`
}

type RailsExplorer struct {
	Name             string `json:"name"`
	URLTx            string `json:"url_tx"`
	URLCTID          string `json:"url_ctid,omitempty"`
	URLAccount       string `json:"url_account,omitempty"`
	URLAccountNonExp string `json:"_url_account,omitempty"`
}

type RailsIcon struct {
	IconSquare string `json:"icon_square"`
	IconAsset  string `json:"icon_asset"`
}

type XpopEndpoints string
